mapper.select:

select 

from ONLINEQC.Y_RGROUTEPOINTTAB
where TENANTID = #{tenantid,jdbcType=VARCHAR}
  and DESTSYSID = #{destsysid,jdbcType=VARCHAR}
  and ROUTEPOINTDBID = #{routepointdbid,jdbcType=VARCHAR}

mapper.delete:

delete from ONLINEQC.Y_RGROUTEPOINTTAB
where TENANTID = #{tenantid,jdbcType=VARCHAR}
  and DESTSYSID = #{destsysid,jdbcType=VARCHAR}
  and ROUTEPOINTDBID = #{routepointdbid,jdbcType=VARCHAR}
